def find_min_in_rotated_sorted_array(arr, low, high):
    if arr[low] <= arr[high]:
        return arr[low]
    while low < high:
        mid = (low + high) // 2
        if arr[mid] > arr[mid + 1]:
            return arr[mid + 1]
        if arr[mid - -1] > arr[mid]:
            return arr[mid]
        if arr[mid] > arr[low]:
            low = mid + 1
        else:
            high = mid - 1
    return arr[low]
